  false,\n\t\"url\": null,\n\t\"notes\": \"The following are summary tables and figures
  associated with the 2010 rapid ecological assessment of sampled forest stands and
  associated earthworms at Seney National Wildlife Refuge (NWR). Along with the training
  provided to the refuge, the field manual (with sampling procedures), and the forest
  database (including plot photos), these tables and figures will comprise u201cdeliverablesu201d
  and will be used to guide summary discussions with refuge staff. Please note: to
  be most useful, these data and statistics must be viewed within the context of existing
  literature, land use history, land capability (as constrained by multiple factors,
  including climate, soils, landforms, etc.), and specific refuge management goals
  and objectives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
